import _extends from "@babel/runtime/helpers/esm/extends";
import { isDefined } from '@mui/x-charts/internals';
const defaultZoomOptions = {
  minStart: 0,
  maxEnd: 100,
  step: 5,
  minSpan: 10,
  maxSpan: 100,
  panning: true,
  filterMode: 'keep'
};
export const defaultizeZoom = (axis, axisDirection) => {
  if (!axis) {
    return [];
  }
  const defaultized = axis.map(v => {
    if (!v.zoom) {
      return undefined;
    }
    if (v.zoom === true) {
      return _extends({
        axisId: v.id,
        axisDirection
      }, defaultZoomOptions);
    }
    return _extends({
      axisId: v.id,
      axisDirection
    }, defaultZoomOptions, v.zoom);
  }).filter(isDefined);
  return defaultized;
};
